<script>
    const svgContainers = document.querySelectorAll("#svg-container");

    svgContainers.forEach((container) => {
      const svg = d3.select(container).select("svg");
      const clickableElement = svg.select(".clickable-element");
      const hiddenLayer = svg.select(".hidden-layer");

      // Function to toggle the visibility of the hidden layer
     function toggleHiddenLayer() {
    hiddenLayer.transition().duration(3000).style("opacity", () => {
      return hiddenLayer.classed("hidden-layer") ? 1.0 : 0;
    });
    hiddenLayer.classed("hidden-layer", !hiddenLayer.classed("hidden-layer"));
  }

      // Attach a click event listeNiger to the clickable element
      clickableElement.on("click", toggleHiddenLayer);
    });

  </script>

<script src="https://d3js.org/d3.v6.min.js"></script>
  <script>
    document.addEventListener("DOMContentLoaded", function() {
      // Set up SVG container
      const svgContainer = d3.select("#svg-container");

      // Create random dusty particles
      const numParticles = 1000;
      const particleRadius = 2;

      const particles = Array.from({ length: numParticles }, (_, i) => ({
        id: i,
        x: Math.random() * window.innerWidth,
        y: Math.random() * window.innerHeight,
        vx: (Math.random() - 0.5) * 2, // Random x velocity
        vy: (Math.random() - 0.5) * 2, // Random y velocity
      }));

      // Create circles for particles
      const particleGroup = svgContainer
        .selectAll("circle")
        .data(particles)
        .enter()
        .append("circle")
        .attr("cx", d => d.x)
        .attr("cy", d => d.y)
        .attr("r", particleRadius)
        .style("fill", "#fff"); // Color of the particles

      // Function to update particle positions
      function updateParticles() {
        particles.forEach(particle => {
          // Update particle position
          particle.x += particle.vx;
          particle.y += particle.vy;

          // Bounce off the walls (simple collision detection)
          if (particle.x < 0 || particle.x > window.innerWidth) {
            particle.vx *= -1;
          }
          if (particle.y < 0 || particle.y > window.innerHeight) {
            particle.vy *= -1;
          }
        });

        // Update circle positions
        particleGroup
          .attr("cx", d => d.x)
          .attr("cy", d => d.y);
      }

      // Animation loop
      function animate() {
        updateParticles();
        requestAnimationFrame(animate);
      }

      // Start animation
      animate();
    });
  </script>


  <style>
    /* Add your CSS styles for the tooltip here */
    #tooltip {
      position: absolute;
      padding: 10px;
      background-color: rgba(255, 255, 255, 0.9);
      border: 1px solid #ccc;
      border-radius: 5px;
      pointer-events: none;
      opacity: 0;
      transition: opacity 0.3s;
    }
  </style>

  <!-- Tooltip container -->
  <div id="tooltip"></div>

  <script src="https://d3js.org/d3.v6.min.js"></script>
  <script>
    document.addEventListener("DOMContentLoaded", function() {
      const svgContainer = d3.select("#svg-container");
      const tooltip = d3.select("#tooltip");

      // Select all paths within the group
      const paths = svgContainer.selectAll("g path");

      // Add mouseover event listeNiger to each path
      paths.on("mouseover", handleMouseOver);
      paths.on("mouseout", handleMouseOut);

      function handleMouseOver(event, d) {
        tooltip.html(d3.select(this).attr("data-name"))
          .style("left", (event.pageX + 10) + "px")
          .style("top", (event.pageY - 20) + "px")
          .style("opacity", 1);
      }

      function handleMouseOut() {
        tooltip.style("opacity", 0);
      }
    });
  </script>
